import {combineReducers} from 'redux';
import {ADD_BOOK, FETCH_POSTS} from './actions';



const initialState = {
    books: [
       {title: "The Book", autor: "Miki Rurk", discription: "Lorem Ispum", }
    ],
}

const booksReducer = (state = initialState, action) => {
    switch(action.type){
        case ADD_BOOK: {
            return state
        }
        default:
            return state
    }
};




export const postsReducer = combineReducers({list: booksReducer});
